from tester import Tester
def print_matrix(matrix, sep=","):
    for i in range(len(matrix)):
        for j in range(len(matrix[i])):
            print(str(matrix[i][j]) + sep, sep="", end="")
        print("")


class Solution:
    def countSquares(self, matrix) -> int:
        s_num = 0
        # c_matrix = matrix.copy()

        for i in range(len(matrix[0])):
            s_num += matrix[0][i]

        for i in range(1, len(matrix)):
            s_num += matrix[i][0]

        # print("initial s_num : {}".format(s_num))
        # print_matrix(c_matrix)
        # print("{},{} :: {}:{}".format(len(matrix), len(matrix[0]), len(c_matrix), len(c_matrix[0])))
        for i in range(1, len(matrix)):
            for j in range(1, len(matrix[i])):
                if matrix[i][j] != 0 and matrix[i-1][j-1] != 0 and matrix[i-1][j] != 0 and matrix[i][j-1] != 0:
                    matrix[i][j] = min(matrix[i-1][j-1], matrix[i][j-1], matrix[i-1][j]) + 1

                s_num += matrix[i][j]

                    # print("----------- {}:{} ----------- : {}".format(i,j, s_num))
                    # print_matrix(c_matrix)

        return s_num

